/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"cover-container d-flex w-100 mx-auto flex-column mb-3\" id=\"about\">\n    <div class=\"middle-content\">\n        <h1>Eric Matamoros</h1>\n    </div>\n    <div class=\"description\">\n        <p>\n            Since I was young I had ever been the most popular guy in the class neither the smartest or the fittest. Indeed, during my school I suffered from bullying as I was a fat guy with classes who was studying all day. Or that is what they thing. I was not\n            just a hard-working guy, I was also getting enough information in order to transform the world.\n        </p>\n        <p>\n            All my childhood has been influenced by my aunt. She had suffered twice from breast cancer, once from tyroid cancer and right now, in 2020, she is undergoing stage IV metastatic lung cancer. Her lungs look like a cake full of small and destructive chocolate\n            bombs. She is my superhero is only one of the more than 8 million superheroes that struggle against cancer every year. I was more focused on what I could do to save her rather than taking care of myself.\n        </p>\n        <p>\n            For that reason, when I was 15 I started my first project at the same time I got tired of my 9-2 school journey without having a real impact on her life and the life of others. At that same time Google released Tensorflow libraries and I decided to make\n            use of my gained expertised in cancer and my understanding on programming in order to make something big. This initial project lately became Biop AI after 3 years. Biop AI is a UK-based company which makes usage of artificial intelligence\n            for the early-stage cancer diagnosis. Our first product focuses on suspicious bad-moles diagnosis versus the healthy ones and is currently under clinical trials.\n        </p>\n        <p>\n            Furthermore, I also co-founded another company in Spain called Nutrilieve for developing personalized diets to oncologic patients undergoing chemotherapy and radiotherapy. The idea with it is to palliate side-effects through the diet.\n        </p>\n        <p>\n            Looks cool right? Definitely. It is not cool just because I am fulfilling an inner passion but because it allows me to be HAPPY. Exactly, how many millions do you want in your bank account if you are not happy? Trading? Dropshipping?\n        </p>\n        <p>\n            What if I told you that you will be rich if you pursue your dreams instead of pursuing society dreams?\n        </p>\n        <p>\n            I have been in Sherm El-Sheik (Africa), Silicon Valley (US), Shenzhen (China), Shangzhuo (China), London (EU), Amsterdam (EU), and many other places without spending a single penny. Guess what? Your knowledge and what you DO is more important than anything\n            else and that is what corporations and associations value on you. Here you have some pictures 😊\n        </p>\n\n        <div class=\"row mt-5\">\n            <div class=\"col-12 col-lg-6\">\n                <img src=\"../../assets/image/Picture11.jpg\" alt=\"Awesome-Pic\" />\n                <p class=\"mt-3 text-center\">Me at Shenzhen for the<br>International AI and Medicine Conference</p>\n            </div>\n            <div class=\"col-12 col-lg-6\">\n                <img src=\"../../assets/image/Picture12.jpg\" alt=\"Awesome-Pic\" />\n                <p class=\"mt-3 text-center\">Me at Silicon Valley<br>Pitching at SharkTank Event</p>\n            </div>\n            <div class=\"col-12 col-lg-6 mt-3\">\n                <img src=\"../../assets/image/Picture13.jpg\" alt=\"Awesome-Pic\" />\n                <p class=\"mt-3 text-center\">Me at Sherm El-Sheik<br>for the World Youth Forum</p>\n            </div>\n            <div class=\"col-12 col-lg-6 mt-3\">\n                <img src=\"../../assets/image/Picture14.jpg\" alt=\"Awesome-Pic\" />\n                <p class=\"mt-3 text-center\">Me awarded by<br>Mr. Abdel Fattah El-Sis</p>\n            </div>\n            <div class=\"col-12 col-lg-12 text-center\">\n                <a href=\"/booking\" class=\"btn btn-green\">Book Me</a>\n            </div>\n        </div>\n    </div>\n</div>");

