/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"cover-container d-flex w-100 mx-auto flex-column\" id=\"welcome\">\n    <div class=\"middle-content\">\n        <h1 i18n>There is only one life<br>You decide what you want to do<br>Act now<br>Help others<br>Change the world</h1>\n        <a class=\"btn btn-bookme\" href=\"/booking\">Book Me</a>\n    </div>\n</div>\n\n<!-- Section 1 -->\n<div class=\"about-story my-3\" id=\"story\">\n    <div class=\"story-about\">\n        <div class=\"story-title text-left\">\n            <h4 i18n>MY STORY</h4>\n        </div>\n        <img src=\"../assets/image/Picture2.jpg\" width=\"100%\" alt=\"ericmatamoros\" />\n    </div>\n    <div class=\"story-description\">\n        <svg preserveAspectRatio=\"xMidYMid meet\" data-bbox=\"0 0 125 264\" xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 125 264\" height=\"492\" width=\"232\" data-type=\"color\" role=\"img\">\n            <g><path fill=\"#9bcb6c\" d=\"M104.167 0H125L20.833 264H0L104.167 0z\" fill-rule=\"evenodd\" data-color=\"1\"></path></g>\n        </svg>\n        <h3 class=\"text-justify\">“Eric and his project Biop AI Ltd. have changed the way cancer is diagnosed towards a better society.”</h3>\n        <p>President of Egypt – Abdel Fattah el-Sisi</p>\n        <h3 class=\"text-justify\">“Eric empowers others to change the world through his uniqueness and wise words. He transmits the passion on what he does and has helped many youngsters to find their way. As he says, there is only one life. You decide to die in a 9-5 full-time\n            job or live doing what you love.”</h3>\n        <p>Xavier Testar – Teacher at University of Barcelona</p>\n    </div>\n</div>\n<div class=\"about-story story_desc my-3\">\n    <div class=\"story-description pt-3\">\n        <svg preserveAspectRatio=\"xMidYMid meet\" data-bbox=\"0 0 125 264\" xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 125 264\" height=\"492\" width=\"232\" data-type=\"color\" role=\"img\">\n            <g><path fill=\"#9bcb6c\" d=\"M104.167 0H125L20.833 264H0L104.167 0z\" fill-rule=\"evenodd\" data-color=\"1\"></path></g>\n        </svg>\n        <p class=\"text-justify\">I suffered from bullying at high school because I was overweight. Depression and video games were my only way of exit of the real world. I started Biop AI Ltd. as a way to fulfil one of my main dreams, save my aunt who is suffering from Stage\n            IV Metastatic Lung Cancer. During this 5-year journey I understood that there is only 1 life to spend such amount of time on getting prepared to be ready for a 9-5 job that won´t fill any little of your happiness. Live or die. Now I am the\n            co-founder of Biop AI and Nutrilieve as well as an international speaker with the aim to change the rules, to help the youngsters and corporates to step outside of the routine and take action by doing things that motivate them and fill the\n            happiness tank.\n        </p>\n        <a href=\"/about\" class=\"btn btn-green\">Read More</a>\n    </div>\n    <div class=\"story-about\">\n        <img src=\"../assets/image/Picture3.jpg\" width=\"100%\" alt=\"ericmatamoros\" />\n    </div>\n</div>\n\n<!-- Section 2 -->\n<div class=\"join-team mt-2\"></div>\n<div class=\"subscription-email\">\n    <h2 class=\"text-center\">Join the mailing list for further news on projects and life time accelerations with Eric.</h2>\n    <div class=\"text-center\">\n        <div class=\"input-group\">\n            <input type=\"text\" class=\"form-control\" placeholder=\"Enter your email here*\" aria-describedby=\"button-addon2\">\n            <div class=\"input-group-append\">\n                <button class=\"btn btn-green\" type=\"button\" id=\"button-addon2\">Join</button>\n            </div>\n        </div>\n    </div>\n</div>\n\n<!-- Section 3 -->\n<div class=\"speaking-section\" id=\"speaking\">\n    <div class=\"section-heading\">\n        <h3>SPEAKING</h3>\n        <p>I simply did too many mistakes. We will all live around 80 years, you decide whether you want to spend your time working for living or you want to live and have an impact on the world. People will remember you for your achievements, not for the\n            money you have on the pocket.</p>\n        <div class=\"row mt-4\">\n            <div class=\"col-md-4\">\n                <iframe width=\"100%\" height=\"225\" src=\"https://www.youtube.com/embed/gCMkzsfxOvU\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n                <p class=\"mt-3 text-video\">Unleash 2019 Keynote Speaker</p>\n            </div>\n            <div class=\"col-md-4\">\n                <iframe width=\"100%\" height=\"225\" src=\"https://www.youtube.com/embed/0g87cImGs9s\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n                <p class=\"mt-3 text-video\">Interview for The Objective</p>\n            </div>\n            <div class=\"col-md-4\">\n                <iframe width=\"100%\" height=\"225\" src=\"https://www.youtube.com/embed/uGtmbt8oW6A\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n                <p class=\"mt-3 text-video\">Interview for Fundació Rafael ElPino</p>\n            </div>\n            <div class=\"col-md-4 mt-3\">\n                <iframe width=\"100%\" height=\"225\" src=\"https://www.youtube.com/embed/ah9eGhNUfj0\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n                <p class=\"mt-3 text-video\">World Youth Forum - Spanish Ambassador</p>\n            </div>\n            <div class=\"col-12 text-center\">\n                <a class=\"btn btn-green mt-3\" href=\"/booking\">Book Me</a>\n            </div>\n        </div>\n        <div class=\"featured-section\">\n            <h2>AS FEATURED IN</h2>\n            <div class=\"carousel\">\n                <div class=\"slide px-3\">\n                    <img src=\"../assets/image/huawei.png\" alt=\"\" width=\"100%\">\n                </div>\n                <div class=\"slide px-3\">\n                    <img src=\"../assets/image/lavanguardia.png\" alt=\"\" width=\"100%\">\n                </div>\n                <div class=\"slide px-3\">\n                    <img src=\"../assets/image/world-youth-form.png\" alt=\"\" width=\"100%\">\n                </div>\n                <div class=\"slide px-3\">\n                    <img src=\"../assets/image/ara.png\" alt=\"\" width=\"100%\">\n                </div>\n                <div class=\"slide px-3\">\n                    <img src=\"../assets/image/tedx.png\" alt=\"\" width=\"100%\">\n                </div>\n            </div>\n        </div>\n    </div>\n</div>");

